import d from "./Export.module.css";

const Export = (props) => {
  const example = () => {
    return (
      <div
        class="Banner_background__1-X9w"
        style="width: 300px; height: 400px; border-radius: 15px; background: linear-gradient(-45deg, rgb(241, 112, 19), rgb(241, 112, 19));"
      >
        <div class="Banner_link__31HaR">
          <a href="http://mail.ru"></a>
        </div>
        <img class="Banner_img__22fRA" src="/mustang.png" alt="" />
        <div class="Banner_textwrapper__2VyaU">
          <h2 class="Banner_text__20uiM">text</h2>
        </div>
      </div>
    );
  };

  return (
    <div className={d.exportwrapper}>
      <div>
        <p>export png</p>
      </div>
      <div>export json</div>
      <div>copy to buffer jsx </div>
    </div>
  );
};

export default Export;
